import React from 'react'
import {Doughnut} from "react-chartjs-2";

function Chart() {
    const data = {
        labels: ["1", "2", "3", "4", "5"],
        datasets: [
            {
                label: 'Videos',
                backgroundColor: 'coral'
            }
        ]
    }
    return (
        <div>
            <Doughnut data={data}
                 width={100}
                 height={150}
                 options={{ maintainAspectRatio: false }}
            />
        </div>
    )
}

export default Chart
